import React from 'react';
import {BrowserRouter, Routes, Route, IndexRoute, useNavigate} from 'react-router-dom';

import Login from './Component/Login';
import Register from './Component/Register';
import Sidebar, {showSidebar} from './Component/Sidebar';
import CardAC from './Component/CardAC';
import Profile from './Component/Profile';
import ViewClubs from './Component/ViewClubs';
import ViewClubSingle from './Component/ViewClubSingle';
import Settings from './Component/Settings';
import Signout from './Component/Signout';

export var url = "http://localhost:3001";

function App() {
  return(
    <BrowserRouter>
        <Routes>
          <Route path = "/" element = {<Login />} />
          <Route path = "/register" element = {<Register />} />
          <Route path = "/home/*" element= {<Sidebar />} />
          <Route path = "/home/ac" element={<CardAC/>} />
          <Route path = "/home/profile" element= {<Profile />} />
          <Route path = "/home/vclubs" element= {<ViewClubs />} />
          <Route path = "/home/vclubs/:id" element= {<ViewClubSingle />} />
          <Route path = "/home/settings" element= {<Settings />} />
          <Route path = "/home/signout" element= {<Signout />} />
        </Routes>
    </BrowserRouter>
  );
}


export default App;
